import React from "react";
import { NavLink } from "react-router-dom";
import styles from "./Navbar.module.css";

const Navbar = () => {
  return (
    <aside className={styles.sidebar}>
      <div className={styles.logo}>FT</div>

      <nav className={styles.nav}>
        <NavLink to="/overview" className={({isActive}) => isActive ? styles.active : styles.link}>
          <span className={styles.icon}>üè†</span>
          <span className={styles.text}>Overview</span>
        </NavLink>

        <NavLink to="/transaction" className={({isActive}) => isActive ? styles.active : styles.link}>
          <span className={styles.icon}>‚ûï</span>
          <span className={styles.text}>Transaction</span>
        </NavLink>

        <NavLink to="/markets" className={({isActive}) => isActive ? styles.active : styles.link}>
          <span className={styles.icon}>üìà</span>
          <span className={styles.text}>Markets</span>
        </NavLink>
      </nav>

      <div className={styles.footer}>
        <div className={styles.avatar}>ZM</div>
        <div className={styles.user}>Zoia M.</div>
      </div>
    </aside>
  );
};

export default Navbar;
